import React from "react";

export default function SectionTag(props) {
  switch (props.sectionName) {
    case "world":
      return (
        <button type="button" className="btn" style={{ background: "#8A2BE2" }}>
          {props.sectionName}
        </button>
      );
      break;
    case "politics":
      return (
        <button type="button" className="btn" style={{ background: "#228B22" }}>
          {props.sectionName}
        </button>
      );
      break;
    case "business":
      return (
        <button
          type="button"
          className="btn"
          style={{ background: "#1E90FF", color: "white" }}
        >
          {props.sectionName}
        </button>
      );
      break;
    case "technology":
      return (
        <button type="button" className="btn" style={{ background: "#7CFC00" }}>
          {props.sectionName}
        </button>
      );
      break;

    case "sports":
      return (
        <button type="button" className="btn" style={{ background: "#FFD700" }}>
          {props.sectionName}
        </button>
      );
      break;

    case "guardian":
      return (
        <button type="button" className="btn" style={{ background: "#000080" }}>
          {props.sectionName}
        </button>
      );
      break;

    case "nytimes":
      return (
        <button type="button" className="btn" style={{ background: "#A9A9A9" }}>
          {props.sectionName}
        </button>
      );
      break;
    default:
      return (
        <button type="button" className="btn" style={{ background: "#696969" }}>
          HEALTH
        </button>
      );
  }
}
